# 日期时间递增 格式yyyymmdd
def getdaylist(beginDate,endDate):
    beginDate = datetime.datetime.strptime(str(beginDate), "%Y%m%d")
    endDate = datetime.datetime.strptime(str(endDate), "%Y%m%d")
    dayList = []
    while beginDate <= endDate:
        dayList.append(datetime.datetime.strftime(beginDate, "%Y%m%d"))
        beginDate += datetime.timedelta(days=+1)
    return dayList

# 根据路径画图
def drawpicture(filePath):
    """
    输入文件路径最后绘制成图G
    """
    global dataMiga
    G = nx.Graph()
    try:
        dataMiga = pd.read_csv(filePath)
    except Exception as problem:
        print("error根据路径画图出现问题：", problem)
    # 得到每一行的数据
    for row in dataMiga.itertuples():
        city_name = getattr(row, "city_name")
        city_id_name = getattr(row, "city_id_name")
        num = getattr(row, "num")
        G.add_edges_from([(city_name, city_id_name)])
    return G


def function_encapsulation(first_data,second_data,third_data,fourth_data,listXData,ax1,title_name):

    def format_fn(tick_val, tick_pos):
        if int(tick_val) in range(len(listXData)):
            return str(listXData[int(tick_val)])
        else:
            return ''
    ax1.xaxis.set_major_formatter(FuncFormatter(format_fn))
    ax1.xaxis.set_major_locator(MaxNLocator(integer=True))
    # plt.ylim((-5, 40))
    # 横坐标每个值旋转90度
    plt.xticks(rotation=45)

    # 坐标轴ticks的字体大小
    ax1.set_xlabel('日期', fontsize=12)  # 为x轴添加标签
    ax1.set_ylabel('数值', fontsize=12)  # 为y轴添加标签  数值
    ax1.legend()
    plt.rcParams['font.sans-serif'] = ['SimHei']
    # 根据需要设置最大最小值，这里设置最大值为1.最小值为0
    # 数据归一化
    tool = MinMaxScaler(feature_range=(0, 1))
    first_data = tool.fit_transform(array(first_data).reshape(-1,1)).tolist()
    second_data = tool.fit_transform(array(second_data).reshape(-1,1)).tolist()
    third_data = tool.fit_transform(array(third_data).reshape(-1,1)).tolist()
    fourth_data = tool.fit_transform(array(fourth_data).reshape(-1,1)).tolist()


    plt.title(title_name,fontsize=12)
    # plt.ylim(0, 0.5)  # 设置x轴范围为0~5
    plt.xticks(fontsize=12)
    plt.yticks(fontsize=12)


    plt.plot(listXData, first_data,  linewidth=2,color="#4F9DA6",  label='平均点连通性') #"4-",人口流动量比例
    plt.plot(listXData, second_data, linewidth=2, color="#1663a9", label='城市度')#, "1--"
    plt.plot(listXData, third_data, linewidth=2, color="#FFAD5A", label='边数量')#, ".-"
    plt.plot(listXData, fourth_data, linewidth=2,  color="#FF5959",label='平均最短路径长度') #, ".-"


    # 石家庄封城开始标记点位 6  封城结束标记点位 28
    # 西安封城开始标记点位 6  封城结束标记点位 28
    plt.scatter(37, 0.9, s=50, color='cyan')  #0.45
    plt.plot([37, 37], [0.9, 0], 'x--', lw=1.5)
    plt.text(38, 0.9, r'封城开始', fontdict={'size': '12', 'color': 'black'})

    plt.scatter(61, 0.9, s=50, color='cyan')
    plt.plot([61, 61], [0.9, 0], 'x--', lw=1.5)
    plt.text(62, 0.9, r'封城结束', fontdict={'size': '12', 'color': 'black'})
    # plt.legend(fontsize=12,  loc="upper left")#fontsize=12  loc="lower right"
